import { atom } from "recoil";

interface ToDo {
  id: number;
  text: string;
}

interface ToDoState {
  [key: string]: toDo[];
}

export const toDoState = atom<ToDoState>({
  key: "toDo",
  default: {
    ToDo: [],
    Doing: [],
    Done: [],
  },
});
